import React, { Component } from "react";
import { FormattedMessage } from "react-intl";
import { connect } from "react-redux";
import { Form, Row, Col, Button, Container } from "react-bootstrap";
class UserRedux extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    componentDidMount() {}

    render() {
        return (
            <div className="user-redux-container">
                <div className="title">User Create Redux by "anhtonton"</div>
                <div className="user-redux-body">
                    <div className="">Thêm mới người dùng</div>
                    <div className="">
                    <Container className="d-flex justify-content-center align-items-center" style={{ height: '100vh' }}>
      <Form>
        <Row className="mb-3">
          <Form.Group as={Col} controlId="formGridEmail">
            <Form.Label>Email</Form.Label>
            <Form.Control type="email" placeholder="Email" />
          </Form.Group>

          <Form.Group as={Col} controlId="formGridPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
        </Row>

        <Row className="mb-3">
          <Form.Group as={Col} controlId="formGridFirstName">
            <Form.Label>First Name</Form.Label>
            <Form.Control type="text" placeholder="First Name" />
          </Form.Group>

          <Form.Group as={Col} controlId="formGridLastName">
            <Form.Label>Last Name</Form.Label>
            <Form.Control type="text" placeholder="Last Name" />
          </Form.Group>
        </Row>

        <Form.Group className="mb-3" controlId="formGridAddress">
          <Form.Label>Address</Form.Label>
          <Form.Control type="text" placeholder="1234 Main St" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formGridPhoneNumber">
          <Form.Label>Phone Number</Form.Label>
          <Form.Control type="text" placeholder="Phone Number" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formGridGender">
          <Form.Label>Gender</Form.Label>
          <Form.Check type="checkbox" label="Male" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formGridImage">
          <Form.Label>Image</Form.Label>
          <Form.Control type="text" placeholder="Image URL" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formGridRoleID">
          <Form.Label>Role ID</Form.Label>
          <Form.Control type="text" placeholder="Role ID" />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formGridPositionId">
          <Form.Label>Position ID</Form.Label>
          <Form.Control type="text" placeholder="Position ID" />
        </Form.Group>

        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </Container>
                    </div>
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {};
};

const mapDispatchToProps = (dispatch) => {
    return {};
};

export default connect(mapStateToProps, mapDispatchToProps)(UserRedux);
